func TestLineScannerLongLine(t *testing.T) {
	var (
		r  = bytes.NewBufferString(testLog)
		ls = NewLineScanner(r)
	)

	for ls.Scan() {
		token := ls.Text()
		if len(token) == 0 {
			t.Error("Got empty token")
		}
	}

	if err := ls.Err(); err != nil {
		t.Fatal(err)
	}
}
